import React from 'react'
import { Typography } from '@material-ui/core'

export default function About(props) {
    return (
        <div {...props} style={{height: "100vh", width: "100%", backgroundColor: "green"}}>
            <Typography>
                About
            </Typography>
        </div>
    )
}
